import React, {Component} from 'react'
import './Header.css'

class Header extends Component {
    render() {
        return (
            <div className="container">
                <div className="headerKu">
                    <span> <input placeholder="search" type="text"/> </span>
                    <span className="mr-3"><a href="/login">Login</a></span>
                    <span style={{
                        borderRightStyle: "solid",
                        borderWidth: "1px",
                        height: "16px",
                        borderColor: "#ebebeb"
                    }}></span>
                    <span className="ml-3"><a href="/register">Register</a></span>
                </div>
            </div>
        )
    }
}

export default Header
